import streamlit as st
import pandas as pd

def app():
  st.markdown('''## Resultados do modelo.''')
  
  
  seleção = st.selectbox(
          'Selecione a análise desejada:',
          ('Curva ROC', 'Matrix de confusão', 'Precision-Recall curve', 'Feature importances'), 
           index = None, placeholder= 'Clique aqui para selecionar a análise desejada')
  
  if seleção == 'Curva ROC':
    col1, col2 = st.columns(2)
  
    with col1:
            st.markdown('#### Curva ROC no modelo de treino.')
            st.markdown('![img](data:image/png;base64,)')
            
    with col2:
            st.markdown('#### Curva ROC no modelo de teste.')
            st.markdown('![img](data:image/png;base64,)')
  
  if seleção == 'Matrix de confusão':
    col1, col2 = st.columns(2)
    with col1:
            st.markdown('#### Matrix de confusão no modelo de treino.')
            st.markdown('![img](data:image/png;base64,)')
            
            st.markdown('#### Recall no modelo de treino:')
            st.markdown('##### 89% para os não diabeticos')
            st.markdown('##### 92% para os diabeticos')
            
    with col2:
            st.markdown('#### Matrix de confusão no modelo de teste.')
            st.markdown('![img](data:image/png;base64,)')
            
            st.markdown('#### Recall no modelo de treino:')
            st.markdown('##### 97% para os não diabeticos')
            st.markdown('##### 96% para os diabeticos')
  
  if seleção == 'Precision-Recall curve':
    col1, col2 = st.columns(2)
    with col1:
            st.markdown('#### Precision-Recall curve no modelo de treino.')
            st.markdown('![img](data:image/png;base64,)')
            
    with col2:
            st.markdown('#### Precision-Recall curve no modelo de teste.')
            st.markdown('![img](data:image/png;base64,)')
  
  if seleção == 'Feature importances':
    col1, col2 = st.columns(2)
    with col1:
            st.markdown('#### Feature importances no modelo de treino.')
            st.markdown('![img](data:image/png;base64,)')
            
    with col2:
            st.markdown('#### Feature importances no modelo de teste.')
            st.markdown('![img](data:image/png;base64,)')
